import React from 'react';

class Contact extends React.Component {
  constructor(props){
    super(props)
  }
  render() {
    return (
      <div className="p-5" style={{height: 'fit-content', backgroundColor: '#CAF0F8', color: '#03045E'}}>
         <h1>Contact</h1>
         <form class="container border-3 d-flex flex-column">
            <label for="email" className="d-flex flex-column">Email 
                <input id="email" type="email" placeHolder="Enter your email" />
            </label>
            <label for="name" className="d-flex flex-column">Name
                <input id="email" type="text" max="50" placeHolder="Enter your name" />
            </label>
            <button type="submit">Contact</button>
         </form>
      </div>
    );
  }
}

export { Contact }
